class Primes:
	def isPrime(number):
		if number in primes: return True
		if number in composites: return False
		if number < -1: return False
		for factor in primes:
			if factor > number ** .5:
				primes.append(number)
				return True
			elif number % factor == 0:
				composites.append(number)
				return False
		primes.append(number)
		return True
	def generatePrimesUpTo(number):
		numbers = list(range(primes[-1], number + 1))
		if numbers:
			for prime in primes:
				index = 0
				while index < len(numbers):
					if numbers[index] % prime == 0:
						numbers = numbers[:index] + numbers[index + 1:]
					else:
						index += 1
			while numbers:
				primes.append(numbers[0])
				numbers = numbers[1:]
				while index < len(numbers):
					if numbers[index] % primes[-1] == 0:
						numbers = numbers[:index] + numbers[index + 1:]
					else:
						index += 1
		else:
			for prime in primes[::-1]:
				if prime <= number:
					return prime
			return -1
